Hubble (IMAX)

Science Documentary hosted by Leonardo DiCaprio, published by IMAX in 2010 - English narration


Information
------------------------------

In May 2009, the crew of the Space Shuttle Atlantis launched a mission to make vital repairs and upgrades to the Hubble Space Telescope, the world's first space-based optical telescope. An IMAXÃƒâ€™ camera captured stunning footage of the five intricate spacewalks required, as well as close-up images of the effort to grasp the orbiting telescope with the shuttle's mechanical arm at 17,000 MPH - and an unexpected problem that could sabotage the entire mission. Hubble combines this breathtaking material with images taken during the 20 years it has been our window into space. Through advanced computer visualization, Hubble's detailed data becomes a series of scientifically realistic flights that unfold on screen like a guided tour of the universe, through time and space.

